  \"2015-10-05T18:01:09.464155\",\n\t\"name\": \"landscape-conservation-cooperatives\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Landscape Conservation Cooperatives (LCCs)
  are public-private partnerships composed of states, tribes, federal agencies, non-governmental
  organizations, universities, international jurisdictions, and others working together
  to address landscape and seascape scale conservation issues. LCCs inform resource
  management decisions to address broad-scale stressors-including habitat fragmentation,
  genetic isolation, spread of invasive species, and water scarcity-all of which are
  magnified by a rapidly changing climate.\",\n\t\"license_title\": null,\n\t\"extras\":
